import React from "react";
import axios from "axios";

function Date() {

    async function getDate() {
        try {
            const response = await axios.get('https://date-calculator2.p.rapidapi.com/datetime/timezone/now', {
                headers: {
                    'X-RapidAPI-Key': '7ab2a76c92msh8d3b37609c76359p13c5a9jsn6d16127b4146',
                    'X-RapidAPI-Host': 'date-calculator2.p.rapidapi.com',
                },
                params: {tzname: 'Etc/GMT+1'},


            });

            const dateNow = response.data.now;
            const dateNowDate = dateNow.substring(0, 10);
            console.log(dateNowDate);

        }

        catch (e) {
            console.error(e);
        }

    }
}

export default Date
